import React from 'react';
import { Link } from 'react-router-dom';
import "./Menu.css"; 
import consulta from "./Imagens/consulta.png";

const Menu = () => {
  return (
    <div className="menu-lateral">
      <h1 className="sidebar-title">Mind Break</h1>
      <Link to="/Inicio" className="menu-button"><img src={consulta} alt="Descrição da imagem" style={{maxWidth: "20%", verticalAlign: "middle"}} />
  Consultas
</Link>
      <Link to="/tela2" className="menu-button">Formulários</Link>
      <Link to="/tela3" className="menu-button">Financeiro</Link>
      <Link to="/tela4" className="menu-button">Pacientes</Link>
    </div>
    
  );
};
export default Menu;
